# -- index vertex payload
# CREATE INDEX vertex_data on vertex USING gin  (data);
# --
# ANALYZE vertex ;
# ANALYZE edge ;
indexes: |
  -- index matrix
  CREATE INDEX matrix_gid_key_val on matrix (gid, key, val);
  CREATE INDEX matrix_val_key_gid on matrix (val, key, gid);
  CREATE INDEX matrix_key_val_gid on matrix (key, val, gid);
  ANALYZE matrix ;


